// src/HomePage.js
import React, { useState } from 'react';
import './HomePage.css';

const HomePage = () => {
    const [diagnosis, setDiagnosis] = useState('');

    const handleDiagnosisSelect = (choice) => {
        setDiagnosis(choice);
    };

    return (
        <div className="container">
            <h1 className="title">Dental Expert System</h1>
            <p className="description">Select a dental diagnosis option below:</p>
            <div className="options">
                <button className="option-button" onClick={() => handleDiagnosisSelect('Cavity')}>
                    Cavity
                </button>
                <button className="option-button" onClick={() => handleDiagnosisSelect('Gum Disease')}>
                    Gum Disease
                </button>
                <button className="option-button" onClick={() => handleDiagnosisSelect('Tooth Sensitivity')}>
                    Tooth Sensitivity
                </button>
            </div>
            {diagnosis && (
                <div className="result">
                    <h2>You selected: {diagnosis}</h2>
                    <p>Here are some recommendations for {diagnosis}...</p>
                </div>
            )}
        </div>
    );
};

export default HomePage;
